import React, { useState } from 'react';
import {
  Box,
  Grid,
  Card,
  CardContent,
  Typography,
  TextField,
  InputAdornment,
  IconButton,
  Chip,
  Stack,
  Button,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Divider,
  Paper,
} from '@mui/material';
import {
  Search as SearchIcon,
  FilterList as FilterIcon,
  Business as BusinessIcon,
  History as HistoryIcon,
  Add as AddIcon,
  Inventory as InventoryIcon,
} from '@mui/icons-material';

const HomePage = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedSize, setSelectedSize] = useState('');
  const [selectedCompany, setSelectedCompany] = useState('');

  const companies = [
    { id: 1, name: 'Eternal Ink LLC', items: 24, lastUpdated: '2024-04-05' },
    { id: 2, name: 'Ink Supply Co', items: 18, lastUpdated: '2024-04-04' },
    { id: 3, name: 'Premium Inks', items: 32, lastUpdated: '2024-04-03' },
  ];

  const historyItems = [
    { id: 1, type: 'import', company: 'Eternal Ink LLC', date: '2024-04-05', details: 'Invoice W3678 imported' },
    { id: 2, type: 'edit', company: 'Ink Supply Co', date: '2024-04-04', details: 'Manual stock adjustment' },
    { id: 3, type: 'import', company: 'Premium Inks', date: '2024-04-03', details: 'Invoice W3677 imported' },
  ];

  const sizeOptions = ['1/2oz', '1oz', '2oz', '4oz', '8oz'];

  return (
    <Box sx={{ p: 3 }}>
      {/* Header Section */}
      <Box sx={{ mb: 4 }}>
        <Typography variant="h4" sx={{ mb: 2, fontWeight: 600 }}>
          Inventory Management
        </Typography>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} md={4}>
            <TextField
              fullWidth
              placeholder="Search companies or items..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon />
                  </InputAdornment>
                ),
              }}
            />
          </Grid>
          <Grid item xs={12} md={3}>
            <FormControl fullWidth>
              <InputLabel>Size</InputLabel>
              <Select
                value={selectedSize}
                label="Size"
                onChange={(e) => setSelectedSize(e.target.value)}
              >
                <MenuItem value="">All Sizes</MenuItem>
                {sizeOptions.map((size) => (
                  <MenuItem key={size} value={size}>
                    {size}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={3}>
            <FormControl fullWidth>
              <InputLabel>Company</InputLabel>
              <Select
                value={selectedCompany}
                label="Company"
                onChange={(e) => setSelectedCompany(e.target.value)}
              >
                <MenuItem value="">All Companies</MenuItem>
                {companies.map((company) => (
                  <MenuItem key={company.id} value={company.id}>
                    {company.name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} md={2}>
            <Button
              fullWidth
              variant="contained"
              startIcon={<AddIcon />}
              sx={{ height: '56px' }}
            >
              New Company
            </Button>
          </Grid>
        </Grid>
      </Box>

      {/* Companies Grid */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        {companies.map((company) => (
          <Grid item xs={12} sm={6} md={4} key={company.id}>
            <Card
              sx={{
                height: '100%',
                cursor: 'pointer',
                transition: 'transform 0.2s',
                '&:hover': {
                  transform: 'translateY(-4px)',
                },
              }}
            >
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                  <BusinessIcon sx={{ mr: 1, color: 'primary.main' }} />
                  <Typography variant="h6" component="div">
                    {company.name}
                  </Typography>
                </Box>
                <Stack direction="row" spacing={1} sx={{ mb: 2 }}>
                  <Chip
                    label={`${company.items} items`}
                    color="primary"
                    variant="outlined"
                  />
                  <Chip
                    label={`Updated: ${company.lastUpdated}`}
                    variant="outlined"
                  />
                </Stack>
                <Button
                  fullWidth
                  variant="outlined"
                  startIcon={<InventoryIcon />}
                >
                  View Inventory
                </Button>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* History Section */}
      <Paper sx={{ p: 3 }}>
        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
          <HistoryIcon sx={{ mr: 1, color: 'primary.main' }} />
          <Typography variant="h6">Recent Activity</Typography>
        </Box>
        <Divider sx={{ mb: 2 }} />
        {historyItems.map((item) => (
          <Box
            key={item.id}
            sx={{
              display: 'flex',
              alignItems: 'center',
              py: 1,
              borderBottom: '1px solid',
              borderColor: 'divider',
            }}
          >
            <Box sx={{ flex: 1 }}>
              <Typography variant="subtitle1">{item.company}</Typography>
              <Typography variant="body2" color="text.secondary">
                {item.details}
              </Typography>
            </Box>
            <Typography variant="caption" color="text.secondary">
              {item.date}
            </Typography>
          </Box>
        ))}
      </Paper>
    </Box>
  );
};

export default HomePage;
